import Note from './Note';
import AddNote from './addNote';
const NoteList = ({notes}) => {
    return <div className="notes-list">
     { notes.map(note => (
        <Note key={note.id} 
        text={note.text} 
        date={note.date}
         />))}
         <AddNote/>
    </div>
    
    
}

